import React, { useRef, useEffect } from "react";

function UseRefHook() {
  const iputRef = useRef();
  useEffect(() => {
    // Foucs It One Time When Component Is Renderd
    iputRef.current.focs();
  }, []);
  return <input ref={iputRef} type={"password"}></input>;
}

export default UseRefHook;
